    const input = e.target.elements.input.value; 

    return (
      <Router>
        <Routes>
          <Route path="/" element={<Home />} /> 
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />
        </Routes>
      </Router>
    );
  }

  return (
    <form onSubmit={handleSubmit}>
      <input name="input" />
      <button type="submit">Submit</button>
    </form>
  );
}

export default App;
